<h3>HTTP1.0</h3>
<p>早先<code>1.0</code>的<code>HTTP</code>版本，是一种<strong>无状态、无连接</strong>的应用层协议。</p>
<p><code>HTTP1.0</code>规定浏览器和服务器保持短暂的连接，浏览器的每次请求都需要与服务器建立一个<code>TCP</code>连接，服务器处理完成后立即断开<code>TCP</code>连接（无连接），服务器不跟踪每个客户端也不记录过去的请求（无状态）。</p>
<p>这种无状态性可以借助<code>cookie/session</code>机制来做身份认证和状态记录。而下面两个问题就比较麻烦了。</p>`,r:{minutes:30.33,words:9100},t:"HTTP1.0HTTP1.1HTTP2.0主要特性对比",i:"pen-to-square",y:"a"}}],["/study/%E8%AE%A1%E7%AE%97%E6%9C%BA%E7%BD%91%E7%BB%9C/HTTP%E4%B8%8EHTTPS%E7%9A%84%E5%8C%BA%E5%88%AB.html",{loader:()=>b(()=>import("./HTTP与HTTPS的区别.html-CtrEqOjV.js"),__vite__mapDeps([65,1])),meta:{d:16418592e5,l:"2022年1月11日",c:["计算机网络"],g:["计算机网络","http","https"],e:`
